import React, { useState } from 'react';
import { Map, TileLayer, Marker, Popup } from 'react-leaflet';
import L from 'leaflet';
import 'leaflet/dist/leaflet.css';

// Configuration des icônes
delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.7.1/images/marker-icon-2x.png',
  iconUrl: 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.7.1/images/marker-icon.png',
  shadowUrl: 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.7.1/images/marker-shadow.png',
});

const TunisiaPage = () => {
  // États et données restent identiques...
  const [selectedGovernorate, setSelectedGovernorate] = useState('');
  const [searchTerm, setSearchTerm] = useState('');

  const governorates = [
    "Tunis", "Ariana", "Ben Arous", "Sfax", "Sousse", 
    "Gabès", "Kairouan", "Bizerte", "Monastir", "Nabeul"
  ];

  const cities = [
    { name: "Tunis", coords: [36.8065, 10.1815] },
    { name: "Sfax", coords: [34.7400, 10.7600] },
    { name: "Sousse", coords: [35.8254, 10.6089] },
    { name: "Gabès", coords: [33.8815, 10.0982] },
    { name: "Kairouan", coords: [35.6711, 10.1007] }
  ];

  const handleSearch = (e) => {
    e.preventDefault();
    console.log('Recherche:', { selectedGovernorate, searchTerm });
  };

  return (
    <div className="main-container">
      {/* Section Recherche inchangée... */}
      
      {/* Section Carte */}
      <div className="map-section">
        <Map
          center={[34.0, 9.0]}
          zoom={6}
          style={{ height: '600px', width: '100%' }}
        >
          <TileLayer
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
          />
          
          {cities.map((city, index) => (
            <Marker key={index} position={city.coords}>
              <Popup>{city.name}</Popup>
            </Marker>
          ))}
        </Map>
      </div>

      {/* Styles restent identiques... */}
    </div>
  );
};

export default TunisiaPage;
